/// season : [{"id":17,"tv_series_id":11,"tmdb_id":"105701","season_no":1,"season_slug":"test","tmdb":"Y","publish_year":"2022","thumbnail":"tmdb_nJUHX3XL1jMkk8honUZnUmudFb9.jpg","poster":null,"actor_id":"191,192,193,194,195","a_language":null,"detail":"","views":0,"featured":0,"type":"S","is_protect":0,"password":null,"trailer_url":null,"created_at":"2022-05-25T03:50:31.000000Z","updated_at":"2022-05-25T03:50:31.000000Z","unique_views_count":4},{"id":3,"tv_series_id":3,"tmdb_id":"3718","season_no":1,"season_slug":"greys-anatomy-season-1","tmdb":"Y","publish_year":"2005","thumbnail":"tmdb_ulGju8GyXE36wCgmvyFJL3sLiVm.jpg","poster":null,"actor_id":"89,90,91,92,93","a_language":"1,2","detail":"The first season of the American television medical drama Grey's Anatomy, began airing in the United States on the American Broadcasting Company on March 27, 2005 and concluded on May 22, 2005. The first season introduces the main character, Meredith Grey, as she enrolls in Seattle Grace Hospital's internship program and faces unexpected challenges and surprises. Season one had nine series regulars, six of whom have been part of the main cast ever since. The season initially served as a mid-season replacement for the legal drama Boston Legal, airing in the Sunday night time slot at 10:00, after Desperate Housewives. Although no clip shows have been produced for this season, the events that occur are recapped in \"Straight to Heart\", a clip-show which aired one week before the winter holiday hiatus of the second season ended. The season was officially released on DVD as two-disc Region 1 box set under the title of Grey's Anatomy: Season One on February 14, 2006 by Buena Vista Home Entertainment.\n\nThe season's reviews and critiques were generally positive, and the series received several awards and nominations for the cast and crew. The first five episodes of the second season were conceived, written and shot to air as the final five episodes of the first season, but aired during the 2005-2006 season due to the high number of viewers that watched \"Who's Zoomin' Who?\", the season's highest-rated episode with 22.22 million viewers tuning in.","views":0,"featured":0,"type":"S","is_protect":0,"password":null,"trailer_url":"https://youtu.be/qbkEtYz9acA","created_at":"2021-08-03T14:50:02.000000Z","updated_at":"2021-08-03T14:50:02.000000Z","unique_views_count":1},{"id":1,"tv_series_id":1,"tmdb_id":"60059","season_no":1,"season_slug":"rick-and-morty-season-1","tmdb":"Y","publish_year":"2013","thumbnail":"tmdb_pZoqbuJGaVM7vgzsSCPwRH5TCx5.jpg","poster":null,"actor_id":"80,81,82,83","a_language":"1","detail":"Rick and Morty visit a pawn shop in space, encounter various alternate and virtual realities, and meet the devil at his antique shop.","views":0,"featured":0,"type":"S","is_protect":0,"password":null,"trailer_url":null,"created_at":"2021-08-03T14:39:23.000000Z","updated_at":"2021-08-03T14:39:23.000000Z","unique_views_count":0},{"id":2,"tv_series_id":2,"tmdb_id":"88380","season_no":1,"season_slug":"the-good-doctor-season-1","tmdb":"Y","publish_year":"2017","thumbnail":"tmdb_hiNyjUSTFrbMv3Sc0CxNW2o39az.jpg","poster":null,"actor_id":"84,85,86,87,88","a_language":"2","detail":"","views":0,"featured":0,"type":"S","is_protect":1,"password":"eyJpdiI6Ii9SanV6QUVpODVFWXJKcDZOUU9GR0E9PSIsInZhbHVlIjoiK1RLdHVxSFNQU3JKeTZmZm8yekhydz09IiwibWFjIjoiMzhjMjc1ODQ0MWQ5NGFmOGEyMzc0ZjU2NTljNjQxOWYzNjg4ZWE4ZDk3Zjc1MmIwMTI2ZTA3ZjhiNDI3YjQ1YiIsInRhZyI6IiJ9","trailer_url":null,"created_at":"2021-08-03T14:45:35.000000Z","updated_at":"2021-08-03T14:45:35.000000Z","unique_views_count":0},{"id":4,"tv_series_id":4,"tmdb_id":"82752","season_no":1,"season_slug":"riverdale-season-1","tmdb":"Y","publish_year":"2017","thumbnail":"tmdb_iyLxqUGwOUurAKMOR8hSXmxMISU.jpg","poster":null,"actor_id":"94,95,96,97,98","a_language":null,"detail":"","views":0,"featured":0,"type":"S","is_protect":0,"password":null,"trailer_url":null,"created_at":"2021-08-03T14:55:05.000000Z","updated_at":"20