class CountViewModel {
  CountViewModel({
    this.movies,
    this.season,
  });

  CountViewModel.fromJson(dynamic json) {
    if (json['movies'] != null) {
      movies = [];
      json['movies'].forEach((v) {
        movies?.add(Movies.fromJson(v));
      });
    }
    if (json['season'] != null) {
      season = [];
      json['season'].forEach((v) {
        season?.add(Season.fromJson(v));
      });
    }
  }
  List<Movies>? movies;
  List<Season>? season;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (movies != null) {
      map['movies'] = movies?.map((v) => v.toJson()).toList();
    }
    if (season != null) {
      map['season'] = season?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

